@EU_Commission In the recent parliamentary elections in Latvia (former Soviet bloc) the party with the most votes was the pro #Russia party with the pro #EU party coming second.
It says a lot about the failure of the EU.
I dislike the @PutinRF_Eng regime greatly but I also dislike the EU.

@EU_Commission Retire? 
Only my dad and grandfather had the right to retire! 
Are You joking?
